import React, { useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { CircularProgress, Container, Typography } from '@mui/material';

const RedirectHandler = () => {
  const { shortcode } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    // Simulate fetching original URL from backend
    const fetchRedirect = async () => {
      try {
        // In real app: make an API call here using shortcode
        console.log("Redirecting for shortcode:", shortcode);

        // Simulate delay and success
        setTimeout(() => {
          window.location.href = 'https://example.com'; // Replace with real fetched URL
        }, 1500);
      } catch (err) {
        console.error(err);
        navigate('/shorten'); // fallback
      }
    };

    fetchRedirect();
  }, [shortcode, navigate]);

  return (
    <Container sx={{ mt: 4, textAlign: 'center' }}>
      <CircularProgress />
      <Typography variant="h6" sx={{ mt: 2 }}>
        Redirecting to original URL...
      </Typography>
    </Container>
  );
};

export default RedirectHandler;
